    },
    {
      img2: "",
      title: "② Add products",
      body: "Add your products to the shop. List your eye-catching products with the best photos, price and descriptions.",
    },
    {
      img3: "",
      title: "③ Start selling",
      body: "Set up payments and shipping, and start selling.",
    },
  ];
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
      }}
    >
      <div
        className="pt-5 mt-5 d-flex "
        style={{
          height: "50vh",
          width: "60%",
          textAlign: "center",
        }}
      >
        {data.map((aData) => (
          <div>
            <h1>logo</h1>
            <h3 style={{}}>{aData.title}</h3>
            <h4>{aData.body} </h4>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Card;
